import React, { useState } from 'react';
import './assets/css/App.css';
import axios from 'axios';

const PocForm = () => {
  const [formData, setFormData] = useState({
    clientName: '',
    cnpj: '',
    salesRepresentative: '',
    sponsor: '',
    requestedSolution: '',
    pocDate: '',
    applicationContext: '',
    chargeClient: '',
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log('Dados do formulário enviados:', formData);

    // Enviar os dados do formulário para o backend
    axios
      .post('http://localhost:5000/api/send-email', formData)
      .then((response) => {
        console.log('Resposta do backend:', response.data);
        alert('Formulário enviado com sucesso! Verifique seu email.');
      })
      .catch((error) => {
        console.error('Erro ao enviar o formulário:', error);
        alert('Ocorreu um erro ao enviar o formulário. Tente novamente mais tarde.');
      });
  };

  return (
    <div className="container">
      <h2>Formulário de Prova de Conceito (POC)</h2>
      <form onSubmit={handleSubmit}>
        <div className="question">
          <label htmlFor="clientName">Informe o nome do cliente:</label>
          <input
            type="text"
            id="clientName"
            name="clientName"
            value={formData.clientName}
            onChange={handleChange}
            required
          />
        </div>
        <div className="question">
          <label htmlFor="cnpj">Informe o CNPJ do cliente:</label>
          <input
            type="text"
            id="cnpj"
            name="cnpj"
            value={formData.cnpj}
            onChange={handleChange}
            required
            pattern="[0-9]{2}\.[0-9]{3}\.[0-9]{3}/[0-9]{4}-[0-9]{2}"
            placeholder="05.703.627/0001-22"
          />
        </div>
        <div className="question">
          <label htmlFor="salesRepresentative">Informe quem é o representante comercial:</label>
          <input
            type="text"
            id="salesRepresentative"
            name="salesRepresentative"
            value={formData.salesRepresentative}
            onChange={handleChange}
            required
          />
        </div>
        <div className="question">
          <label htmlFor="sponsor">Quem é o sponsor do projeto (principal representante do cliente) e número de contato?</label>
          <input
            type="text"
            id="sponsor"
            name="sponsor"
            value={formData.sponsor}
            onChange={handleChange}
            required
            placeholder="Exemplo: JONAS - (11) 97044-2255"
          />
        </div>
        <div className="question">
          <label htmlFor="requestedSolution">Qual a solução solicitada?</label>
          <select
            id="requestedSolution"
            name="requestedSolution"
            value={formData.requestedSolution}
            onChange={handleChange}
            required
          >
            <option value="">Selecione...</option>
            <option value="Controle de Patrimônio">Controle de Patrimônio</option>
            <option value="Controle de Estoque">Controle de Estoque</option>
            <option value="Controle Logístico">Controle Logístico</option>
            <option value="Controle de Enxoval">Controle de Enxoval</option>
            <option value="Controle de Packs (Têxtil)">Controle de Packs (Têxtil)</option>
            <option value="Controle de Acesso">Controle de Acesso</option>
            <option value="Controle de Furto">Controle de Furto</option>
            <option value="Loja Autônoma">Loja Autônoma</option>
            <option value="Monitoramento">Monitoramento</option>
            <option value="Rastreamento">Rastreamento</option>
            <option value="Outro">Outro</option>
          </select>
        </div>
        <div className="question">
          <label htmlFor="pocDate">Existe data definida para a POC? Se sim, qual?</label>
          <input
            type="text"
            id="pocDate"
            name="pocDate"
            value={formData.pocDate}
            onChange={handleChange}
            required
          />
        </div>
        <div className="question">
          <label htmlFor="applicationContext">Descreva o contexto de aplicação e os pontos a serem controlados:</label>
          <textarea
            id="applicationContext"
            name="applicationContext"
            value={formData.applicationContext}
            onChange={handleChange}
            required
          ></textarea>
        </div>
        <div className="question">
          <label htmlFor="chargeClient">A POC será cobrada do cliente?</label>
          <select
            id="chargeClient"
            name="chargeClient"
            value={formData.chargeClient}
            onChange={handleChange}
            required
          >
            <option value="">Selecione...</option>
            <option value="SIM">SIM</option>
            <option value="NÃO">NÃO</option>
          </select>
        </div>
        <button type="submit">Enviar</button>
      </form>
    </div>
  );
};

export default PocForm;
